  const [ name , setname] = useState("")
  return(
    <>
      <form>
       <label>
        Enter your credentials
        <input 
        type='text'
        value={name}
        onChange={(e) => setname(e.target.value)}
         />
       </label>
      </form>
    </>
  );
}
const root = ReactDOM.createRoot(document.getElementById("root"));
